namespace SignalRMVCChat.TelegramBot.OperatorBot.Bussiness
{
    public class TelegramMultimediaSenderToBotService
    {

        private OpBotChatService opBotChatService = Injector.Inject<OpBotChatService>();
        private TelegramBotChatService TelegramBotChatService = Injector.Inject<TelegramBotChatService>();

        internal async Task SendToAdmin(int customerId, int websiteid, Chat chat)
        {

            opBotChatService.CustomerSendtoOperatorTelegram(
                 customerId, chat.MultimediaContent
                 , chat.MyAccountId.Value, websiteid,true);

        }

      
    }



    [TestClass]
    public class MultimediaImgSendExampleTest
    {

        [TestMethod]
        public void Test()
        {
            MyDependencyResolver.RegisterDependencies();

            string base64Img = @"data:image/jpeg;base64,";

            var nextPart=base64Img.Split(',')[1];
            var extention=base64Img.Split(',')[0].Split('/')[1];

            byte[] byteArray = Encoding.UTF32.GetBytes(nextPart);

            var bot=TelegramBotMockService.GetBot();

            var telegramBotSettingService = DependencyInjection.Injector.Inject
                 <TelegramBotSettingService>();
            var setting = telegramBotSettingService.GetQuery()
                .First();

            var msg = TelegramBotMockService.GetMessage("@" + setting.UniqOperatorCodes.First());

            byte[] bytes = Convert.FromBase64String(nextPart);

            MemoryStream stream = new MemoryStream(bytes);


            bot.SendPhotoAsync(
                                msg.Message.Chat.Id,
                              new Telegram.Bot.Types.InputFiles.InputOnlineFile(

                                 stream)).GetAwaiter().GetResult();
        }
    }
